import { Box, TextField, Typography } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import React, { useState } from "react";
import './Order.css';

const ProductSummary = ({ route}) => {
  const { prodName,imgUrl, catagory,Description,Price } = route.params;
  const [totalPrice,settotalPrice]=useState(0);
  const [totalQuentity,settotalQuentity]=useState(1);
 console.log(JSON.stringify(prodName));
  return (
    <Box sx={{ width: "75%",margin:'auto',marginTop:10}}>
      <Grid2
        container
        direction="row"
        alignItems="center"
        columns={{ xs: 4, sm: 8, md: 12 }}
      >
        <Grid2 xs={5}>
            <img className="imgProductDtl" src={JSON.stringify(imgUrl)}></img>
        </Grid2>
        <Grid2 xs={7}>
          <Typography variant="h5">{JSON.stringify(prodName)}</Typography>
          <Typography variant="h6">{JSON.stringify(catagory)}</Typography>
          <Typography variant="h6">{JSON.stringify(Description)}</Typography>
          <Typography variant="h6">{JSON.stringify(Price)*totalQuentity}</Typography>
          <TextField
                label="Enter Quentity"
                variant="outlined"
                margin="normal"
                width="100"
                size="small"
                value={totalQuentity}
                onChange={(e) => settotalQuentity(e.target.value)}
            />
        </Grid2>
      </Grid2>
      </Box>
  );
};

export default ProductSummary;
